import React from 'react'

const Dashboard = () => {
const logoutHandler = () =>{
    localStorage.clear()
    console.log("logout");

}
  return (
    <div>
      <p>Dashboard</p>
      <button onClick={logoutHandler}>Logout</button>
    </div>
  )
}

export default Dashboard
